import React from "react";
import Header from "../BooksSearchPage/Header.js";
function Page() {
  return (
    <React.Fragment>
      <Header
        url={JSON.parse(localStorage.getItem("cred")).user.photoURL}
      ></Header>
    </React.Fragment>
  );
}
export default Page;
